    [],nt"revision_timestamp": "2013-03-15T21:20:10.513924",nt"name": "land-cover-classification-for-fanno-creek-oregon",nt"isopen":
    false,nt"url": null,nt"notes": "Fanno Creek is a tributary to the Tualatin
    River and flows though parts of the southwest Portland metropolitan area. The stream
    is heavily influenced by urban runoff and shows characteristic flashy streamflow
    and poor water quality commonly associated with urban streams. This data set represents
    the floodplain land cover as derived from light detection and ranging (LiDAR) data
    and aerial photographic imagery. The land cover classifications represent current
    conditions (2009).",nt"license_title": null,nt"extras": [{ntt"key":
